{
"type":"html", 
"text": "<p>In general, alcohol-based disinfectants (ethanol, propan-2-ol, propan1-ol) have been shown to significantly reduce infectivity of enveloped viruses like SARS-CoV-2, in concentrations of 70-80% with one minute exposure time.<a href='https://www.ecdc.europa.eu/sites/default/files/documents/Environmental-persistence-of-SARS_CoV_2-virus-Options-for-cleaning2020-03-26_0.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>To date, there is no vaccine and no specific antiviral medicine to prevent or treat COVID-2019. However, those affected should receive care to relieve symptoms. People with serious illness should be hospitalized. Most patients recover thanks to supportive care. Possible vaccines and some specific drug treatments are under investigation.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Make sure you, and the people around you, follow good respiratory hygiene. This means covering your mouth and nose with your bent elbow or tissue when you cough or sneeze. Then dispose of the used tissue immediately. <br>Droplets spread virus and by following good respiratory hygiene you protect the people around you from viruses such as cold, flu and COVID-19.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>When someone coughs or sneezes they spray small liquid droplets from their nose or mouth which may contain virus. If you are too close, you can breathe in the droplets, including the COVID-19 virus if the person coughing has the disease. Thatâ€™s why itâ€™s important to maintain at least 1 meter (3 feet) distance between yourself and anyone who is coughing or sneezing.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>The following measures are not effective against COVID-2019 and can be harmful:<ul><li>smoking;</li><li>taking traditional herbal remedies;</li><li>wearing multiple masks;</li><li>taking self-medication such as antibiotics.</li></ul>If you have fever, cough and difficulty breathing, seek medical care early to reduce the risk of developing a more severe infection and be sure to share your recent travel history with your health care provider.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>You should avoid touching eyes, nose and mouth because hands touch many surfaces and can pick up viruses. Once contaminated, hands can transfer the virus to your eyes, nose or mouth. From there, the virus can enter your body and can make you sick.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Regularly and thoroughly clean your hands with an alcohol-based hand rub or wash them with soap and water. <br>Washing your hands with soap and water or using alcohol-based hand rub kills viruses that may be on your hands.<a href='https://www.who.int/gpsc/clean_hands_protection/en/' target='_blank'>(1)</a></p>"
}

