{
"type":"html", 
"text": "<p>Stay aware of the latest information on the COVID-19 outbreak, available on the WHO website and through your national and local public health authority. Many countries around the world have seen cases of COVID-19 and several have seen outbreaks. <br>Authorities in China and some other countries have succeeded in slowing or stopping their outbreaks. However, the situation is unpredictable so check regularly for the latest news.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>If you have a fever, cough and difficulty breathing, seek medical attention and call in advance. <br>Calling in advance will allow your health care provider to quickly direct you to the right health facility. This will also protect you and help prevent spread of viruses and other infections.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Self-isolate by staying at home if you begin to feel unwell, even with mild symptoms such as headache, low-grade fever (37.3 C or above) and slight runny nose, until you recover. Avoiding contact with others and visits to medical facilities will allow these facilities to operate more effectively and help protect you and others from possible COVID-19 and other viruses.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>You can reduce your chances of being infected or spreading COVID-19 by taking some simple precautions: <ul><li> regularly clean your hands with an alcohol-based hand rub or wash them with soap and water;</li> <li>maintain at least 1 meter (3 feet) distance between yourself and anyone who is coughing or sneezing; </li> <li>avoid touching eyes, nose and mouth; </li> <li>make sure you, and the people around you, follow good respiratory hygiene; </li> <li>stay home if you feel unwell. </li></ul>If you have a fever, cough and difficulty breathing, seek medical attention and call in advance. Follow the directions of your local health authority.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public' target='_blank'>(1)</a></p>"
}

