{
"type":"html", 
"text": "<p>There has been no report of transmission of COVID-19Â via food and therefore there is no evidence that food items imported into theÂ EuropeanÂ Union in accordance with the applicable animal and public healthÂ regulations pose a risk for the health of EU citizensÂ in relationÂ to COVID-19. The main mode of transmission is from person to person.<a href='https://www.ecdc.europa.eu/en/novel-coronavirus-china/questions-answers' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Studies to date suggest that the virus that causes COVID-19 is mainly transmitted through contact with respiratory droplets rather than through the air.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>There is a possibility for some animals to become infected through close contact with infected humans. Further evidence is needed to understand if animals and pets can spread the disease. Based on current evidence, human to human transmission remains the main driver.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>The risk of severe disease in the EU/EEA and UK is currently considered low for the general population in areas where appropriate physical distancing measures are in place and/or where community transmission has been reduced and/or maintained at low levels.<a href='https://www.ecdc.europa.eu/en/current-risk-assessment-novel-coronavirus-situation' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>The risk of catching COVID-19 from the feces of an infected person appears to be low. While initial investigations suggest the virus may be present in feces in some cases, spread through this route is not a main feature of the outbreak. However, because this is a risk, it is important to clean hands regularly, after using the bathroom and before eating.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>The risk of catching COVID-19 from someone with no symptoms at all is very low. However, many people with COVID-19 experience only mild symptoms. This is particularly true in the early stages of the disease. It is therefore possible to catch COVID-19 from someone who has, for example, just a mild cough and does not feel ill.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Coronaviruses are a large family of viruses that are common in animals. Possible animal sources of COVID-19 have not yet been confirmed. To protect yourself, such as when visiting live animal markets, avoid direct contact with animals and surfaces in contact with animals. Ensure good food safety practices at all times. Handle raw meat, milk or animal organs with care to avoid contamination of uncooked foods and avoid consuming raw or undercooked animal products.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>COVID-19 can pass from person to person through small droplets from the nose or mouth which are spread when a person with the virus coughs or exhales. These droplets land on objects and surfaces around the person. Other people then catch it by touching these objects or surfaces, then touching their eyes, nose or mouth. <br>People can also catch COVID-19 if they breathe in droplets from a person with COVID-19 who coughs out or exhales droplets.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Persons infected with the virus must not leave the quarantine. This also means that they should not take the dog into the streets or parks. However, if the person has their own house, they are allowed to move around on your property with the dog. However, social contacts may not be perceived even in this case. If the person is not infected, walks with the dog are allowed. Keep a distance of at least 1-2 metres to other people outside.</p>"
}

{
"type":"html", 
"text": "<p>Wash your hands regularly and thoroughly and follow the cough and sneeze label. Avoid touching your face. Keep a minimum distance of 2 metres from other people and avoid hugs, kisses, handshakes, etc. Do not leave your home unless absolutely necessary. Therefore, refrain from any kind of social events. If it is absolutely necessary to leave the house, avoid public transport as far as possible. Ask your employer for home work. And last but not least: Don't panic!<a href='https://www.ecdc.europa.eu/sites/default/files/documents/Leaflet-Covid-19_Isolation-and-quarantine.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Anyone can help contain the further spread of the novel coronavirus by staying home and keeping physical contact to a minimum. This is necessary to protect risk groups and reduce the burden in hospitals as much as possible. How long this situation can continue is still uncertain. But we can certainly reduce the duration by staying at home consistently.<a href='https://www.ecdc.europa.eu/sites/default/files/documents/Leaflet-Covid-19_Isolation-and-quarantine.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Customers behave irrationally because they make panic purchases that are not necessary for fear of a shortage of goods. This includes toilet paper. However, the supply of goods is absolutely guaranteed. Often the employees simply could not keep up with refilling the shelves fast enough.<a href='https://www.ecdc.europa.eu/sites/default/files/documents/Leaflet-Covid-19_Isolation-and-quarantine.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Persons who are infected, have had contact with infected persons or have stayed in risk areas are officially ordered a 14-day quarantine. During this period, the Robert Koch Institute recommends that those affected must take their temperature twice a day, keep a diary of their symptoms, take swabs on request and be available to the staff of the public health department. They are to report to the sick person daily. Persons who have not been quarantined must nevertheless observe the ban on contact. Violations of the contact restrictions should be monitored by the regulatory authorities and the police and sanctions should be imposed in the event of violations.<a href='https://www.ecdc.europa.eu/sites/default/files/documents/Leaflet-Covid-19_Isolation-and-quarantine.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Anyone who has been ordered into quarantine because they are infected or at risk of infection is obliged to stay at home and keep their distance from third parties. The person concerned must not leave the house for shopping or walking the dog. Relatives can support the contact person in everyday life, e.g. by shopping.<a href='https://www.ecdc.europa.eu/sites/default/files/documents/Leaflet-Covid-19_Isolation-and-quarantine.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Introducing quarantine measures early in an outbreak may delay the introduction of the disease to a country or area or may delay the peak of an epidemic in an area where local transmission is ongoing, or both. It is recommended that contacts of patients with laboratory-confirmed COVID-19 be quarantined for 14 days.<a href='https://www.who.int/publications-detail/considerations-for-quarantine-of-individuals-in-the-context-of-containment-for-coronavirus-disease-(covid-19)' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Garlic is a healthy food that may have some antimicrobial properties. However, there is no evidence from the current outbreak that eating garlic has protected people from the new coronavirus.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>The likelihood of an infected person contaminating commercial goods is low and the risk of catching the virus that causes COVID-19 from a package that has been moved, travelled, and exposed to different conditions and temperature is also low.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>There is no evidence that regularly rinsing the nose with saline has protected people from infection with the new coronavirus. There is some limited evidence that regularly rinsing nose with saline can help people recover more quickly from the common cold. However, regularly rinsing the nose has not been shown to prevent respiratory infections.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>In times of COVID-19 spread, the increasing uncertainty and concern of people are the ideal breeding ground for conspiracy theories, false reports or myths. People often find out about the virus on various YouTube channels where online activists believe they know the true origin of the virus. False reports are also increasingly circulating via social media such as Facebook or WhatsApp. This can, for example, lead to increasing panic and panic buying. Therefore, please make sure that you only inform yourself on official websites such as those of the WHO or the ECDC.</p>"
}

{
"type":"html", 
"text": "<p>Hand dryers are not effective in killing the virus. <br>To protect yourself against the COVID-19, you should frequently clean your hands with an alcohol-based hand rub or wash them with soap and water. Once your hands are cleaned, you should dry them thoroughly by using paper towels or a warm air dryer.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>There is no reason to believe that cold weather can kill the new coronavirus or other diseases. The normal human body temperature remains around 36.5Â°C to 37Â°C, regardless of the external temperature or weather.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>From the evidence so far, the COVID-19 virus can be transmitted in all areas, including areas with hot and humid weather. <br>Regardless of climate, adopt protective measures if you live in, or travel to an area reporting COVID-19.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Taking a hot bath will not prevent you from catching COVID-19. Your normal body temperature remains around 36.5Â°C to 37Â°C, regardless of the temperature of your bath or shower. Actually, taking a hot bath with extremely hot water can be harmful, as it can burn you.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Antibiotics do not work against viruses, only bacteria. <br>The SARS-CoV-2 is a virus and, therefore, antibiotics should not be used as a means of prevention or treatment.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>UV lamps should not be used to sterilize hands or other areas of skin as UV radiation can cause skin irritation.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Sesame oil does not kill the new coronavirus. <br>There are some chemical disinfectants that can kill the SARS-CoV-2 on surfaces. These include bleach/chlorine-based disinfectants, either solvents, 75% ethanol, peracetic acid and chloroform.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Vaccines against pneumonia, such as pneumococcal vaccine and Haemophilus influenza type B (Hib) vaccine, do not provide protection against the new coronavirus. The virus is so new and different that it needs its own vaccine.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Spraying alcohol or chlorine all over your body will not kill viruses that have already entered your body. Spraying such substances can be harmful to clothes or mucous membranes (i.e. eyes, mouth). Be aware that both alcohol and chlorine can be useful to disinfect surfaces, but they need to be used under appropriate recommendations.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Viruses cannot travel on radio waves/mobile networks.<br>COVID-19 is spreading in many countries that do not have 5G mobile networks.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Thermal scanners are effective in detecting people who have developed a fever, however, they cannot detect people who are infected but are not yet sick with fever. This is because it takes between 2 and 10 days before people who are infected become sick and develop that symptom.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/myth-busters' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Studies to date suggest that the virus that causes COVID-19 is mainly transmitted through contact with respiratory droplets rather than through the air. However, according to a study from EID Journal, it is believed the droplet transmission was prompted by air-conditioned ventilation in an outbreak in a restaurant in Wuhan, China.<a href='https://wwwnc.cdc.gov/eid/article/26/7/20-0764_article' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>After use, take off the mask: remove the elastic loops from behind the ears while keeping the mask away from your face and clothes, to avoid touching potentially contaminated surfaces of the mask. Discard the mask in a closed bin immediately after use. <br>Perform hand hygiene after touching or discarding the mask â€“ use alcohol-based hand rub or, if visibly soiled, wash your hands with soap and water.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/when-and-how-to-use-masks' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>After use, take off the mask: remove the elastic loops from behind the ears while keeping the mask away from your face and clothes, to avoid touching potentially contaminated surfaces of the mask. Discard the mask in a closed bin immediately after use. <br>Perform hand hygiene after touching or discarding the mask â€“ use alcohol-based hand rub or, if visibly soiled, wash your hands with soap and water.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/when-and-how-to-use-masks' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Before putting on a mask it is important to clean hands with alcohol-based hand rub or soap and water. Inspect it for tears or holes. <br>Orient which side is the top side (where the metal strip is), then ensure the proper side of the mask faces outwards (the colored side). Place the mask to your face and pinch the metal strip or stiff edge of the mask so it molds to the shape of your nose. Finally pull down the maskâ€™s bottom so it covers your mouth and your chin.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/advice-for-public/when-and-how-to-use-masks' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Masks should be used as part of a comprehensive strategy of measures to suppress transmission and save lives; the use of a mask alone is not sufficient to provide an adequate level of protection against COVID-19. You should also maintain a minimum physical distance of at least 1 meter from others, frequently clean your hands and avoid touching your face and mask.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/question-and-answers-hub/q-a-detail/q-a-on-covid-19-and-masks' target='_blank'>(1)</a></p>"
}

