{
"type":"html", 
"text": "<p>Who has returned from an area where COVID-19 is spreading should monitor themselves for symptoms for 14 days and take their temperature twice a day. If you develop even a mild cough or low-grade fever (i.e. a temperature of 37.3 C or more) you should stay at home and self-isolate. This means avoiding close contact (one meter or nearer) with other people, including family members. You should also telephone your healthcare provider or the local public health department, giving them details of your recent travel and symptoms.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/travel-advice' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Wash your hands regularly and stay at least one meter away from people who are coughing or sneezing and make sure you know what to do and who to contact if you feel ill while traveling. Comply with instructions from local authorities where you are traveling. <br>If, for example, you are told by local authorities not to go somewhere, you should comply with this. You should comply with any local restrictions on travel, movement or large gatherings.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/travel-advice' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Make sure you have the latest information on areas where COVID-19 is spreading. Based on that information, you should assess the benefits and risks related to upcoming travel plans.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/travel-advice' target='_blank'>(1)</a></p>"
}

