}

{
"type":"html", 
"text": "<p>Disease in children appears to be relatively rare and mild. About 2.4% of the total reported cases were individuals under 19 years of age. A very small proportion of those aged under 19 years have developed severe (2.5%) or critical disease (0.2%).<a href='https://www.ecdc.europa.eu/sites/default/files/documents/RRA-outbreak-novel-coronavirus-disease-2019-increase-transmission-globally-COVID-19.pdf' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>\"Severe acute respiratory syndrome coronavirus 2\" (SARS-CoV-2) is the name of the new virus because it is genetically related to the coronavirus responsible for the SARS outbreak of 2003. <br>\"COVID-19\" is the name of this new disease, following guidelines previously developed with the World Organisation for Animal Health (OIE) and the Food and Agriculture Organization of the United Nations (FAO).<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/technical-guidance/naming-the-coronavirus-disease-(covid-2019)-and-the-virus-that-causes-it' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Experiences from previous outbreaks of related coronaviruses, such as the Severe Acute Respiratory Syndrome coronavirus (SARS-CoV) and Middle East respiratory syndrome coronavirus (MERS-CoV) show that transmission through food consumption did not occur. To date, there have not been any reports of transmission of SARS-CoV-2 virus through food, however, concerns were expressed about the potential for these viruses to persist on raw foods of animal origin.<a href='https://www.who.int/emergencies/diseases/novel-coronavirus-2019/situation-reports' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Unfortunately,Â it is not possible toÂ predictÂ how long the outbreak will last and how the epidemic will unfold.Â We are dealing with a new virus and therefore a lot of uncertainty remains. For instance, it is not knownÂ whetherÂ transmission within the EU/EEA will naturally decrease during the northern hemisphere summer,Â asÂ isÂ observed forÂ seasonalÂ influenza.<a href='https://www.ecdc.europa.eu/en/novel-coronavirus-china/questions-answers' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>Coronaviruses are a large family of viruses which may cause respiratory infections ranging from the common cold to more severe diseases such as Middle East Respiratory Syndrome (MERS) and Severe Acute Respiratory Syndrome (SARS). The most recently discovered coronavirus causes coronavirus disease COVID-19.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>A pandemic is the worldwide spread of a new disease and occurs when a new virus emerges and spreads around the world, and most people do not have immunity. Viruses that have caused past pandemics typically originated from animal influenza viruses.<a href='https://www.who.int/csr/disease/swineflu/frequently_asked_questions/pandemic/en/' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>The \"incubation period\" means the time between catching the virus and beginning to have symptoms of the disease. <br>Most estimates of the incubation period for COVID-19 range from 1-14 days, most commonly around five days.<a href='https://www.who.int/news-room/q-a-detail/q-a-coronaviruses' target='_blank'>(1)</a></p>"
}

{
"type":"html", 
"text": "<p>In the event of a suspected case, special safety criteria are applied, which are recommended by the Ministry of Health in consultation with experts and specialists and derived from international guidelines. A sick person is isolated, contact persons are identified, informed and, depending on the situation, can be quarantined, for example. All measures aim to ensure that as few people as possible are infected by the pathogen.<a href='https://www.ecdc.europa.eu/en/case-definition-and-european-surveillance-human-infection-novel-coronavirus-2019-ncov' target='_blank'>(1)</a></p>"
}

{
